import React, { Component } from 'react'
import logo from "../Constant/logo.svg";
import "./NavBar.css";

class NavBar extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {


    return (
      <nav className="navbar">

        <div className="navbar-container">

          {/* Logo */}
          <div className="navbar-logoContainer">
            <img src={logo} />
          </div>

          {/* Main Tabs/Routes */}
          <div className="navbar-tabContainer">
            <a><span>UX Projects</span></a>
            <a><span>Open Design</span></a>
            <a><span>About</span></a>
          </div>

          {/* Secondary Tabs/Routes */}
          <div className="navbar-tabContainer">
            <a><span>UX Projects</span></a>
          </div>

        </div>
      </nav>
    );
  }
}

export default NavBar;
